import axios from 'axios';
import './App.css'
import { useState } from 'react';

function App() {
  const [dataToServer, setDataServer] = useState('');

  const sendData = async () => {
    try {
      await axios.post('http://127.0.0.1:8080', { tweet: dataToServer });
      setDataServer('')
    } catch (error) {
      console.log(error);
    }
  };

  return (
    <div className="App">
      <button id='' onClick={sendData}>Twit</button>
      <input value={dataToServer} type="text" onChange={e=>setDataServer(e.target.value)}  />
    </div>
  );
}

export default App;
